import React, { Component } from "react";
import { render } from 'react-dom';
import { WOW } from 'wowjs/dist/wow';
import { Row, Col, Container, Card, Image, rounded, fluid, ListGroup, ListGroupItem, horizontal } from "react-bootstrap";

import CardRFAssoc from "../components/card/Card-RFAssoc";
import CardSummitTech from "../components/card/Card-SummitTech";
import CardPamcor from "../components/card/Card-Pamcor";

class ContactPage extends Component {
  componentDidMount() {
    new WOW().init()
  }

  render() {
    return (
      <div className="container">
        <Container className="wow fadeInDown" id="companyOverview">
          <Row>
            <Col sm={12}>
              <h3><strong>CONTACT US</strong></h3>
            </Col>
          </Row>
        </Container>
        <Container>
          <Row>
            <h5><strong>North America</strong></h5>
          </Row>
        </Container>
        <Container>

          <Row>
            <p><strong>Connecticut, Maine, Massachusetts, New Hampshire, Rhode Island, Vermont</strong></p>
          </Row>
          <CardRFAssoc />
        </Container>
        <Container>
          <Row>
            <p><strong>Northern California, Northern Nevada</strong></p>
          </Row>
          <CardSummitTech />
        </Container>
        <Container>
          <Row>
            <p><strong>Southern California, Southern Nevada</strong></p>
          </Row>
          <CardPamcor />
        </Container>
      </div>
    )
  }
};

export default ContactPage;
